package com.gagsn.db.dto;public class PublicationTitle {    private String id;    private String displayCode;    public PublicationTitle(String id, String displayCode) {        this.id = id;        this.displayCode = displayCode;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getDisplayCode() {        return displayCode;    }    public void setDisplayCode(String displayCode) {        this.displayCode = displayCode;    }}